    steps:
      - welcome:
          script:
            - echo 'STARTED'
            - echo export GIT_SSH_COMMAND=\"ssh -i /home/local/.ssh/vd-bb\" > ./gitize
            - source gitize
            - git ls-remote git@bitbucket.org:vamche/welcome-pipelines.git
            - echo export GIT_SSH_COMMAND=\"ssh -i /home/local/.ssh/abc-vdee\" > ./gitize
            - source gitize
            - git ls-remote git@bitbucket.org:vdee/welcome-pipelines.git
