            - source gitize
            - git ls-remote git@bitbucket.org:fsmawi007/test.git
            - ssh -v -i /home/local/.ssh/vd-bb git@bitbucket.org && git ls-remote git@bitbucket.org:vamche/sbapi.git
            - ssh -v -i /home/local/.ssh/fs-bb-2 git@bitbucket.org && git ls-remote git@bitbucket.org:fsmawi008/test.git
            - cat welcome.txt
